INSERT INTO `news_item201911` VALUES (1,'96m²',NULL,'Bán nhà biệt thự, liền kề tại Khu đô thị Lakeview City','Dự án Lakeview City (Novaland), p. An Phú, quận 2, TPHCM, Việt Nam nơi xây tổ ấm, thực hiện giấc mơ. Nhà xây 1 trệt, 3 lầu, hoàn thiện bên ngoài kính cường lực, sơn nước chống rêu mốc chất lượng, có cửa kính cường lực, gara ô tô để xe thoải mái. + Có trung tâm thương mại, trường học, công viên, hồ bơi, phòng tập gym, khu vui chơi trẻ em, sân tennis, siêu thị Mini Mart. + Giao thông thuận tiện do nằm trên mặt tiền đường Song Hành cao tốc TP Hồ Chí Minh - Long Thành Dầu Giây, quận 2, TPHCM, thuận tiện di chuyển qua các khu vực Q1, Q2, Q7, Q9, sân bay Long Thành Đồng Nai, đi Vũng Tàu. - Nhà phố 1 trệt, 2 lầu, hoàn thiện bên ngoài giao thô bên trong, có gara ô tô trước nhà, cửa kính cường lực, ngân hàng Vietcombank, VPBank hỗ trợ 70% thời gian 15 năm. Các loại diện tích và giá bán nhà: Bán nhà phố, biệt thự dự án Lakeview City với quy mô dự án 30.1 hecta, quy hoạch đồng bộ với 963 căn nhà phố, biệt thự và shophouse. Đặc biệt có hồ sinh thái 3.6ha với nhiều cảnh quan đẹp. - Giá bán nhà phố: 6x16m, 1 trệt, 3 lầu giá 9.6 tỷ đến 10 tỷ. 5x20m, 1 trệt, 3 lầu giá 10.3 tỷ đến 12.5 tỷ. 5x20m, 1 trệt, 3 lầu giá 13.8 tỷ view hồ lớn sinh thái. 6x20, 1 trệt, 3 lầu giá 12,8 tỷ đến 13 tỷ. 8x20m, 1 trệt, 3 lầu giá 15 tỷ đến 16 tỷ view sông thoáng mát. - Biệt thự - shophouse. Biệt thự sông 8x20m, 1 trệt, 2 lầu giá 15.4 tỷ đến 17 tỷ góc 2 mặt tiền view sông. Biệt thự hồ 8x22m, 1 trệt, 2 lầu giá 18.9 tỷ. Biệt thự hồ 10x20m, 1 trệt, 2 lầu giá 20 tỷ. Shophouse nội khu 5x20m, 1 trệt, 1 lửng, 3 lầu giá 12.2 tỷ đến 12,5 tỷ. Shophouse 5x20m, 1 trệt, 1 lửng, 3 lầu giá 15 tỷ đến 15,5 tỷ mặt tiền đường R. Shophouse Song Hành 5x20m, 1 trệt, 1 lửng, 3 lầu giá 18.8 tỷ đến 18.9 tỷ. Mời đi xem thực tế dự án Lakeview City, liên hệ Mr. Sự 0902 442 039 bạn sẽ có 1 chuyến tham tuyệt vời và có ngôi nhà mới.',NULL,'4 (tầng)','6 (m)','Thiết kế tinh tế và hiện đại.','Wed, 28 Aug 2019 15:49:32 GMT',1566